import{_ as t,c as e,o as s,a0 as a}from"./chunks/framework.KI8OJlDW.js";const u=JSON.parse('{"title":"技术组通用文档","description":"","frontmatter":{"title":"技术组通用文档"},"headers":[],"relativePath":"zh-Hans/docs/tech.md","filePath":"zh-Hans/docs/tech.md"}'),p={name:"zh-Hans/docs/tech.md"};function c(n,o,r,i,l,m){return s(),e("div",null,o[0]||(o[0]=[a('<h1 id="技术组通用文档" tabindex="-1">技术组通用文档 <a class="header-anchor" href="#技术组通用文档" aria-label="Permalink to &quot;技术组通用文档&quot;">​</a></h1><h2 id="commit-messages-的写法" tabindex="-1">Commit Messages 的写法 <a class="header-anchor" href="#commit-messages-的写法" aria-label="Permalink to &quot;Commit Messages 的写法&quot;">​</a></h2><p>自 2023 年 2 月 20 日起，One Among Us 所有代码仓库的 commit messages 均采用以下格式：</p><blockquote><p>[*] Do something</p></blockquote><p>整条 message 以英文写作。以方括号内的标记符开头，方括号后加一个空格，再以大写 <strong>动词</strong> 起始描述基本的更改点，句末不加标点符号。如果有在一行之内写不下或认为不必写在标题的内容，请在之后以更加具体的 commit message 作为补充。每行不超过 72 英文字符。</p><p><strong>标记符</strong></p><blockquote><p>[+] 添加</p><p>[-] 移除</p><p>[U] 更新 (Update) 修改 (Modify)</p><p>[O] 优化 (Optimization)</p><p>[F] 修复 (Fix)</p><p>[S] 样式 (Style)</p><p>[M] 移动 (Move) <sup class="footnote-ref"><a href="#footnote1">[1]</a><a class="footnote-anchor" id="footnote-ref1"></a></sup></p><p>[R] 重构（Refactor）</p><p>[T] 测试 (Test)</p><p>[D] 文档 (Documentation)</p><p>[B] 备份（Backup）</p><p>[PR] Merge commit of pull request</p></blockquote><p><strong>例子</strong></p><blockquote><p>[+] Add entry for sauricat</p></blockquote><p>添加 sauricat 的条目。</p><blockquote><p>[U] Update photos for sauricat</p></blockquote><p>更新 sauricat 的照片。</p><blockquote><p>[F] Fix punctuation</p></blockquote><p>修改标点符号。</p><p><em>Under Construction...</em></p><hr class="footnotes-sep"><section class="footnotes"><ol class="footnotes-list"><li id="footnote1" class="footnote-item"><p>习惯上也可能用 [M] 表示修改（Modify），但此时更推荐用 [U]。 <a href="#footnote-ref1" class="footnote-backref">↩︎</a></p></li></ol></section>',17)]))}const d=t(p,[["render",c]]);export{u as __pageData,d as default};
